DROP TABLE IF EXISTS ts_campus;
CREATE TABLE `ts_campus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '用户id',
  `place` varchar(40) DEFAULT NULL COMMENT '地点',
  `info` text COMMENT '描述',
  `tags` varchar(255) DEFAULT NULL COMMENT '标签',
  `readCount` int(11) unsigned DEFAULT '0' COMMENT '阅读次数',
  `savepath` varchar(255) DEFAULT NULL COMMENT '图片地址',
  `size` int(11) DEFAULT '0',
  `width` int(11) DEFAULT '0' COMMENT '图片宽度',
  `height` int(11) DEFAULT '0' COMMENT '图片高度',
  `cTime` int(11) unsigned DEFAULT NULL COMMENT '创建时间',
  `mTime` int(11) unsigned DEFAULT NULL COMMENT '最后修改时间',
  `isDel` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有效 0有效1无效',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_campus_like;
CREATE TABLE `ts_campus_like` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '用户id',
  `campusId` int(11) DEFAULT NULL COMMENT '图片id',
  `campusUid` int(11) DEFAULT NULL COMMENT '作者id',
  `cTime` int(11) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_canlendar;
CREATE TABLE `ts_canlendar` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `firstdate` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


