DROP TABLE IF EXISTS ts_class;
CREATE TABLE `ts_class` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deptid` int(11) NOT NULL,
  `logo` varchar(255) DEFAULT NULL COMMENT 'LOGO',
  `logan` varchar(255) DEFAULT NULL COMMENT '班级口号',
  `message` varchar(255) DEFAULT NULL COMMENT '班主任寄语',
  `info` text,
  `visitcount` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_class_announce;
CREATE TABLE `ts_class_announce` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deptid` int(11) NOT NULL,
  `useremail` varchar(255) NOT NULL COMMENT '发布人',
  `title` varchar(255) NOT NULL COMMENT '公告标题',
  `content` text NOT NULL,
  `aTime` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='班级公告表';


DROP TABLE IF EXISTS ts_class_course;
CREATE TABLE `ts_class_course` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deptid` int(11) NOT NULL COMMENT '部门id',
  `year` varchar(10) NOT NULL COMMENT '哪年课程表',
  `semester` int(2) NOT NULL COMMENT '学期',
  `weekday` int(2) NOT NULL COMMENT '周几',
  `festival` int(2) NOT NULL COMMENT '第几节',
  `subjectid` int(5) NOT NULL COMMENT '班级课程id',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_class_honor;
CREATE TABLE `ts_class_honor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `users` text NOT NULL,
  `title` varchar(255) NOT NULL,
  `content` text NOT NULL,
  `hTime` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_class_manager;
CREATE TABLE `ts_class_manager` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userType` int(11) NOT NULL COMMENT '用户角色',
  `typeName` varchar(100) NOT NULL COMMENT '权限名称',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_class_per_subject;
CREATE TABLE `ts_class_per_subject` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `deptid` int(11) NOT NULL,
  `subjectid` int(11) NOT NULL,
  `teach_eamil` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_class_photo;
CREATE TABLE `ts_class_photo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `attachId` int(11) DEFAULT NULL,
  `albumId` int(11) DEFAULT NULL,
  `deptid` int(11) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `name` varchar(255) DEFAULT NULL,
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  `info` text,
  `commentCount` int(11) unsigned DEFAULT '0',
  `readCount` int(11) unsigned DEFAULT '0',
