DROP TABLE IF EXISTS ts_club_notice;
CREATE TABLE `ts_club_notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id.',
  `clubid` int(11) DEFAULT NULL COMMENT '社团id.',
  `uid` int(11) DEFAULT NULL COMMENT '用户id.',
  `content` varchar(255) DEFAULT NULL COMMENT '公告内容.',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间.',
  `isdel` int(1) DEFAULT '0' COMMENT '是否删除.0未删除，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_club_reply;
CREATE TABLE `ts_club_reply` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id.',
  `topicid` varchar(255) DEFAULT NULL COMMENT '主题id.',
  `uid` varchar(255) DEFAULT NULL COMMENT '作者id.',
  `content` text COMMENT '内容.',
  `replyid` int(11) DEFAULT NULL COMMENT '回复的id.0回复论坛主题，非0回复本表对应的id',
  `replyuid` int(11) DEFAULT NULL COMMENT '回复的作者.',
  `floor` int(11) DEFAULT '0' COMMENT '楼层数.',
  `ctime` int(11) DEFAULT NULL COMMENT '回复时间.',
  `isdel` int(1) DEFAULT '0' COMMENT '是否删除.0未删除，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_club_title;
CREATE TABLE `ts_club_title` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id.',
  `clubid` int(11) DEFAULT NULL COMMENT '社团id.',
  `title` varchar(30) DEFAULT NULL COMMENT '头衔名称.',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间.',
  `isdel` int(1) DEFAULT '0' COMMENT '是否删除.0未删除，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_club_topic;
CREATE TABLE `ts_club_topic` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id.',
  `clubid` int(11) DEFAULT NULL COMMENT '所属社团id.',
  `uid` int(11) DEFAULT NULL COMMENT '作者uid.',
  `title` varchar(255) DEFAULT NULL COMMENT '主题标题.',
  `type` int(1) DEFAULT NULL COMMENT '主题类型.1帖子,2活动',
  `issue` int(11) DEFAULT '0' COMMENT '若是活动，则保存活动的期数',
  `zding` int(1) DEFAULT '0' COMMENT '是否置顶帖子.1是 0否',
  `tjian` int(1) DEFAULT '0' COMMENT '是否推荐帖子.1是 0否',
  `topicpic` varchar(255) DEFAULT NULL COMMENT '主题缩略图',
  `content` text COMMENT '内容.',
  `replycount` int(11) DEFAULT '0' COMMENT '回复数.',
  `clickcount` int(11) DEFAULT '0' COMMENT '点击数.',
  `ctime` int(11) DEFAULT NULL COMMENT '发布时间.',
  `replytime` int(11) DEFAULT NULL COMMENT '最后回复时间.',
  `replyuid` int(11) DEFAULT NULL,
  `replyman` int(1) DEFAULT '0' COMMENT '可回复的人.0所有人，1仅社团成员',
  `isdel` int(1) DEFAULT '0' COMMENT '是否删除.0未删除，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college;
CREATE TABLE `ts_college` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '群组ID - 自动增长',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户UID',
  `title` varchar(32) NOT NULL COMMENT '群组标题',
  `intro` text NOT NULL COMMENT '群组简介',
  `logo` varchar(255) NOT NULL COMMENT '群组Logo',
  `announce` text NOT NULL COMMENT '群组公告',
  `cid0` smallint(6) unsigned NOT NULL COMMENT '群组大分类',
  `cid1` smallint(6) unsigned NOT NULL COMMENT '群组小分类',
  `membercount` smallint(6) unsigned NOT NULL DEFAULT '1' COMMENT '群组成员数目',
  `viewcount` int(6) NOT NULL DEFAULT '1',
  `topiccount` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '群组话题数',
  `need_verify` tinyint(4) NOT NULL COMMENT '群组是否要审核',
  `is_upfile` tinyint(4) NOT NULL DEFAULT '1' COMMENT '允许上传你附件 - 1 - 可以，0 - 不可以',
  `ctime` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `mtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '群组状态 - 1 - 开启 ，0 - 关闭',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除  1- 删除，0 - 没有删除',
  `ismember` tinyint(1) NOT NULL DEFAULT '0' COMMENT '成员审核 0 - 要求审核 1 - 不用审核',
  `istopic` tinyint(1) NOT NULL DEFAULT '0' COMMENT '非成员回答问题 0 - 不可以，1 - 可以',
  `isattachment` tinyint(1) NOT NULL DEFAULT '0' COMMENT '非会员下载附件 0 - 不可以， 1 - 可以',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college_attachment;
CREATE TABLE `ts_college_attachment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '群组上传附件增长ID',
  `cid` int(11) unsigned NOT NULL COMMENT '群组ID',
  `uid` int(11) unsigned NOT NULL COMMENT '用户ID',
  `title` varchar(32) NOT NULL COMMENT '文件名称',
  `note` text NOT NULL COMMENT '文档备注',
  `filesize` int(10) NOT NULL DEFAULT '0' COMMENT '文件大小 ',
  `filetype` varchar(10) NOT NULL COMMENT '文件类型',
  `fileurl` varchar(255) NOT NULL COMMENT '文件链接',
  `downnum` int(6) NOT NULL DEFAULT '0' COMMENT '总下载数量',
  `ctime` int(11) NOT NULL COMMENT '添加时间',
  `mtime` varchar(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `alevel` tinyint(1) NOT NULL DEFAULT '0' COMMENT '附件等级',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除 0 - 没有删除， 1 - 已经删除',
  PRIMARY KEY (`id`),
  KEY `cid` (`cid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


