DROP TABLE IF EXISTS ts_college_ding;
CREATE TABLE `ts_college_ding` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `uid` int(8) NOT NULL DEFAULT '0',
  `rid` int(8) NOT NULL DEFAULT '0',
  `ctime` int(4) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college_invite_verify;
CREATE TABLE `ts_college_invite_verify` (
  `invite_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '发送邀请自动增长ID',
  `cid` int(11) NOT NULL COMMENT '群组ID',
  `uid` int(11) NOT NULL COMMENT '邀请的UID',
  `is_used` int(11) NOT NULL DEFAULT '0' COMMENT '是否使用邀请 0 - 没有使用 1 - 已经使用',
  PRIMARY KEY (`invite_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college_member;
CREATE TABLE `ts_college_member` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '群组会员自动增长ID',
  `cid` int(11) unsigned NOT NULL COMMENT '群组ID',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户UID',
  `reason` text COMMENT '申请理由',
  `mlevel` tinyint(2) unsigned NOT NULL DEFAULT '1' COMMENT '用户权限 1 - 普通用户 2 - 管理员用户',
  `ctime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `mtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` tinyint(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `cid` (`cid`,`uid`) USING BTREE,
  KEY `mid` (`uid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college_reply;
CREATE TABLE `ts_college_reply` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '回复自动增长ID',
  `uid` int(11) unsigned NOT NULL COMMENT '用户UID',
  `tid` int(11) unsigned NOT NULL COMMENT '群组问答ID',
  `content` text NOT NULL COMMENT '回复内容',
  `ding` int(11) NOT NULL DEFAULT '0' COMMENT '有用数量',
  `ip` char(16) NOT NULL COMMENT '回复的IP地址',
  `ctime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `is_del` varchar(1) NOT NULL DEFAULT '0' COMMENT '是否删除 0 - 没有 1 - 已经删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_college_topic;
CREATE TABLE `ts_college_topic` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '问答自动增长ID',
  `cid` int(11) unsigned NOT NULL COMMENT '群组ID',
  `uid` int(11) unsigned NOT NULL COMMENT '用户ID',
  `title` varchar(255) NOT NULL COMMENT '问答标题',
  `cnt` varchar(500) NOT NULL COMMENT '问答内容',
  `viewcount` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '查看次数',
  `replycount` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '回复次数',
  `istop` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否置顶 0 - 否，1 - 是',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 - 回答关闭 1 - 回答没有关闭',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `mtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  `is_del` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除 ，0 - 没有删除， 1 - 已经删除',
  PRIMARY KEY (`id`),
  KEY `cid` (`cid`) USING BTREE,
  KEY `cid_2` (`cid`,`uid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_comment;
CREATE TABLE `ts_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` char(15) DEFAULT NULL,
  `appid` int(11) DEFAULT NULL,
  `appuid` int(11) DEFAULT NULL,
  `name` varchar(30) DEFAULT NULL,
  `uid` int(11) DEFAULT NULL,
  `comment` text,
  `cTime` int(12) DEFAULT NULL,
  `toId` int(11) NOT NULL DEFAULT '0',
  `status` int(1) DEFAULT '0',
  `quietly` tinyint(1) NOT NULL DEFAULT '0',
  `to_uid` int(11) NOT NULL DEFAULT '0',
  `data` text,
  PRIMARY KEY (`id`),
  KEY `type` (`type`) USING BTREE,
  KEY `appid` (`appid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

