  `address` char(100) DEFAULT NULL,
  `pageType` varchar(20) DEFAULT NULL,
  `provider` varchar(8) DEFAULT NULL,
  `comment` longtext,
  `type` smallint(10) DEFAULT NULL,
  `editTime` int(11) DEFAULT NULL,
  `logo` char(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=59 DEFAULT CHARSET=utf8;

