DROP TABLE IF EXISTS ts_live;
CREATE TABLE `ts_live` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cate_id` int(11) DEFAULT NULL COMMENT '频道类别',
  `userId` int(11) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `name` varchar(255) DEFAULT NULL,
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  `info` text,
  `commentCount` int(11) unsigned DEFAULT '0',
  `readCount` int(11) unsigned DEFAULT '0',
  `file` varchar(255) DEFAULT NULL,
  `streamer` varchar(255) DEFAULT NULL,
  `thumb` varchar(255) DEFAULT NULL,
  `privacy` int(1) NOT NULL DEFAULT '1',
  `tags` text,
  `isHot` tinyint(1) NOT NULL DEFAULT '0',
  `order` int(11) NOT NULL DEFAULT '0',
  `isDel` tinyint(1) NOT NULL DEFAULT '0',
  `playbill` varchar(300) NOT NULL COMMENT '节目单',
  `play_thumb` varchar(255) DEFAULT NULL COMMENT '节目截图',
  `playlist_type` varchar(20) DEFAULT NULL,
  `playlist` varchar(20) DEFAULT NULL COMMENT '节目今日列表',
  `cctv_playlist` varchar(20) DEFAULT NULL COMMENT '搜视节目单地址',
  `start_time` time DEFAULT NULL,
  `end_time` time DEFAULT NULL,
  `gTime` int(11) DEFAULT NULL COMMENT '节目单最后更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=118 DEFAULT CHARSET=utf8;

