DROP TABLE IF EXISTS ts_live_category;
CREATE TABLE `ts_live_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '分类id递增',
  `cate_title` char(255) DEFAULT NULL COMMENT '分类名称',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

