DROP TABLE IF EXISTS ts_meeting;
CREATE TABLE `ts_meeting` (
  `meetingId` int(11) NOT NULL AUTO_INCREMENT,
  `useremail` varchar(50) NOT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `meetingName` varchar(255) DEFAULT NULL,
  `attendeePw` varchar(255) DEFAULT NULL,
  `moderatorPw` varchar(255) DEFAULT NULL,
  `welcomeMsg` text,
  `dialNumber` varchar(50) DEFAULT NULL,
  `voiceBridge` varchar(255) DEFAULT NULL,
  `logoutUrl` varchar(50) DEFAULT NULL,
  `maxParticipants` int(8) DEFAULT NULL,
  `record` int(8) DEFAULT NULL,
  `starttime` varchar(11) NOT NULL,
  `endtime` varchar(11) NOT NULL,
  PRIMARY KEY (`meetingId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_meeting_join;
CREATE TABLE `ts_meeting_join` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `juseremail` varchar(50) NOT NULL,
  `juserid` int(11) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_message;
CREATE TABLE `ts_message` (
  `message_id` int(11) NOT NULL AUTO_INCREMENT,
  `from_uid` int(11) NOT NULL,
  `to_uid` int(11) NOT NULL,
  `title` varchar(255) DEFAULT NULL,
  `content` text,
  `source_message_id` int(255) NOT NULL DEFAULT '0',
  `is_read` tinyint(1) NOT NULL DEFAULT '0',
  `is_lastest` tinyint(1) NOT NULL DEFAULT '1',
  `deleted_by` int(11) NOT NULL DEFAULT '0',
