DROP TABLE IF EXISTS ts_mobile_push_tokens;
CREATE TABLE `ts_mobile_push_tokens` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) unsigned NOT NULL DEFAULT '0',
  `token` char(70) NOT NULL DEFAULT '''''',
  `type` enum('2','0','1') NOT NULL DEFAULT '1' COMMENT '1:ios,2:android',
  `status` enum('0','1') NOT NULL DEFAULT '1' COMMENT '0为禁用1为可用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_monitor_equipment;
CREATE TABLE `ts_monitor_equipment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `ename` varchar(255) DEFAULT NULL,
  `eurl` varchar(255) DEFAULT NULL,
  `eroad` int(11) DEFAULT NULL,
  `eport` int(11) DEFAULT NULL,
  `eusername` varchar(255) DEFAULT NULL,
  `epassword` varchar(255) DEFAULT NULL,
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  `info` text,
  `privacy` int(1) NOT NULL DEFAULT '1',
  `order` int(11) NOT NULL DEFAULT '0',
  `isDel` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


