DROP TABLE IF EXISTS ts_dsk_urlshare;
CREATE TABLE `ts_dsk_urlshare` (
  `urlsid` int(10) NOT NULL AUTO_INCREMENT,
  `uid` mediumint(10) unsigned NOT NULL DEFAULT '0',
  `username` varchar(255) NOT NULL,
  `icoid` int(10) unsigned NOT NULL DEFAULT '0',
  `dateline` int(10) unsigned NOT NULL DEFAULT '0',
  `password` varchar(255) NOT NULL,
  `expired` int(10) unsigned NOT NULL DEFAULT '0',
  `viewnum` int(10) unsigned NOT NULL DEFAULT '0',
  `downnum` int(10) unsigned NOT NULL DEFAULT '0',
  `allowdownnum` int(10) unsigned NOT NULL DEFAULT '0',
  `savenum` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '转存次数',
  PRIMARY KEY (`urlsid`),
  KEY `uid` (`uid`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_dsk_userconfig;
CREATE TABLE `ts_dsk_userconfig` (
  `uid` mediumint(8) unsigned NOT NULL,
  `username` varchar(255) NOT NULL DEFAULT '',
  `docklist` text NOT NULL,
  `systemlist` text NOT NULL,
  `navbarlist` text NOT NULL,
  `screenlist` text NOT NULL COMMENT '每个屏幕的图标',
  `iconpositions` text NOT NULL,
  `thame` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `updatetime` int(10) unsigned NOT NULL,
  `custom_backimg` varchar(255) NOT NULL,
  `custom_url` varchar(255) NOT NULL,
  `custom_window` varchar(255) NOT NULL,
  `custom_dock` varchar(255) NOT NULL,
  `custom_btype` tinyint(1) unsigned NOT NULL,
  `custom_browser` varchar(255) NOT NULL DEFAULT '',
  `custom_filemanage` varchar(255) NOT NULL,
  `custom_topbar` varchar(255) NOT NULL,
  `custom_navbar` varchar(255) NOT NULL,
  `spacename` varchar(255) NOT NULL,
  `metakeyword` varchar(255) NOT NULL,
  `metadescription` varchar(255) NOT NULL,
  `friend` tinyint(1) NOT NULL DEFAULT '-1',
  `friendids` text NOT NULL,
  `current` varchar(255) NOT NULL DEFAULT '0',
  `ukey` varchar(16) NOT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `viewnum` int(10) unsigned NOT NULL DEFAULT '0',
  `usesize` bigint(20) NOT NULL DEFAULT '0',
  `mids` text NOT NULL,
  `tempfid` int(10) NOT NULL DEFAULT '0',
  `recyclefid` int(10) NOT NULL DEFAULT '0',
  UNIQUE KEY `uid` (`uid`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `viewnum` (`viewnum`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

