DROP TABLE IF EXISTS ts_live_click_count;
CREATE TABLE `ts_live_click_count` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `live_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `click_time` int(11) DEFAULT NULL,
  `click_count` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_live_comment;
CREATE TABLE `ts_live_comment` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `liveId` int(10) NOT NULL,
  `userId` int(10) NOT NULL,
  `commentContent` char(100) NOT NULL,
  `cTime` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_live_playlist;
CREATE TABLE `ts_live_playlist` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `list` char(255) DEFAULT NULL,
  `live_name` char(255) DEFAULT NULL,
  `time` date DEFAULT NULL,
  `week` int(11) DEFAULT NULL,
  `live_id` int(11) DEFAULT NULL,
  `p_time` char(255) DEFAULT NULL,
  `p_name` char(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_live_schoolradio;
CREATE TABLE `ts_live_schoolradio` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `title` char(255) DEFAULT NULL COMMENT '上传文件标题',
  `message` char(255) DEFAULT NULL COMMENT '简介',
  `fcode` varchar(255) DEFAULT NULL,
  `savepath` varchar(255) DEFAULT NULL,
  `savename` varchar(255) DEFAULT NULL,
  `time` int(11) DEFAULT NULL COMMENT '上传时间',
